#include <iostream>
#include <algorithm>
#include <map>
#include <vector>
#include <limits.h>
using namespace std;

class Solution
{
  public:
    int gcd(int a, int b)
    {
        // Everything divides 0
        if (a == 0)
            return b;
        if (b == 0)
            return a;

        // base case
        if (a == b)
            return a;

        // a is greater
        if (a > b)
            return gcd(a - b, b);
        return gcd(a, b - a);
    }

    bool hasGroupsSizeX(vector<int> &deck)
    {
        int count = 0;
        int g = -1;
        map<int, int> m;
        for (auto a : deck)
        {
            m[a]++;
        }
        map<int, int>::iterator it = m.begin();
        int X = INT_MIN;
        int x = INT_MAX;
        while (it != m.end())
        {
            count++;
            if (it->second < 2)
                return false;
            if (it->second < x)
                x = it->second;
            if (it->second > X)
                X = it->second;
            it++;
        }
        if (count == 1)
        {
            if (X >= 2 && X % 2 == 0)
                return true;
            else
                return false;
        }

        for (auto a : m)
        {
            if (g == -1)
                g = a.second;
            else
                g = gcd(g, a.second);
        }
        cout << "GCD : " << g << endl;
        if (g >= 2)
            return true;
        return false;
    }
};

